import "./Card.css";
import React from "react";
import bitcoin from "./bitcoin.png"

const Card = () =>{

    return(
        <div className="card">
            <div className="card-holder">
                <div className="image-div">
                    <img src={bitcoin} alt="" />
                </div>
                <div className="details-div">
                    <ul>
                        <li><p>Name</p></li>
                        <li><p>Price</p></li>
                        <li><p>Current</p></li>
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Card;
